{
  "root": true,
  "env": {
    "browser": true,
    "node": true,
    "es6": true
  },
  "extends": [
    "eslint:recommended",
    "plugin:prettier/recommended"
  ],
  "parser": "@typescript-eslint/parser",
  "rules": {
    "no-console": "warn",
    "max-len": ["error", { "code": 120, "ignoreUrls": true }]
  },
  "overrides": [
    {
      "files": ["**/*.ts"],
      "extends": [
        "eslint:recommended",
        "plugin:@typescript-eslint/eslint-recommended",
        "plugin:@typescript-eslint/recommended",
        "plugin:prettier/recommended"
      ],
      "plugins": [
        "@typescript-eslint"
      ],
      "rules": {
        "max-len": ["error", { "code": 120, "ignoreUrls": true }],
        "@typescript-eslint/no-unused-vars": ["error", { "ignoreRestSiblings": true }]
      }
    }
  ]
}

import { makeKarmaConfigurator } from '@fpjs-incubator/broyster/node'

module.exports = makeKarmaConfigurator({
  projectName: 'FingerprintJS',
  includeFiles: ['src/**/*.ts', 'tests/**/*.ts', 'dist/fp.min.js'],
})

import * as fs from 'fs'
import type { RollupOptions } from 'rollup'
import jsonPlugin from '@rollup/plugin-json'
import nodeResolvePlugin from '@rollup/plugin-node-resolve'
import typescriptPlugin from '@rollup/plugin-typescript'
import terserPlugin from '@rollup/plugin-terser'
import dtsPlugin from 'rollup-plugin-dts'
import licensePlugin from 'rollup-plugin-license'
import terserConfig from './terser.config'

const { dependencies } = JSON.parse(fs.readFileSync('package.json', 'utf8'))

const outputDirectory = 'dist'

const commonInput = {
  input: 'src/index.ts',
  plugins: [nodeResolvePlugin(), jsonPlugin(), typescriptPlugin()],
}

const commonOutput = {
  name: 'FingerprintJS',
  exports: 'named' as const,
  plugins: [
    licensePlugin({
      banner: {
        content: {
          file: 'resources/license_banner.txt',
        },
        data: {
          license: fs.readFileSync('LICENSE', 'utf8').trim(),
        },
      },
    }),
  ],
}

const commonTerser = terserPlugin(terserConfig)

const config: RollupOptions[] = [
  // Browser bundles. They have all the dependencies included for convenience.
  {
    ...commonInput,
    output: [
      // IIFE for users who use Require.js or Electron and want to just call `window.FingerprintJS.load()`
      {
        ...commonOutput,
        file: `${outputDirectory}/fp.js`,
        format: 'iife',
      },
      {
        ...commonOutput,
        file: `${outputDirectory}/fp.min.js`,
        format: 'iife',
        plugins: [commonTerser, ...commonOutput.plugins],
      },

      // UMD for users who use Require.js or Electron and want to leverage them
      {
        ...commonOutput,
        file: `${outputDirectory}/fp.umd.js`,
        format: 'umd',
      },
      {
        ...commonOutput,
        file: `${outputDirectory}/fp.umd.min.js`,
        format: 'umd',
        plugins: [commonTerser, ...commonOutput.plugins],
      },
    ],
  },

  // NPM bundles. They have all the dependencies excluded for end code size optimization.
  {
    ...commonInput,
    external: Object.keys(dependencies),
    output: [
      // CJS for usage with `require()`
      {
        ...commonOutput,
        file: `${outputDirectory}/fp.cjs.js`,
        format: 'cjs',
      },

      // ESM for usage with `import`
      {
        ...commonOutput,
        file: `${outputDirectory}/fp.esm.js`,
        format: 'esm',
      },
    ],
  },

  // TypeScript definition
  {
    ...commonInput,
    plugins: [dtsPlugin()],
    output: {
      ...commonOutput,
      file: `${outputDirectory}/fp.d.ts`,
      format: 'esm',
    },
  },
]

export default config

// Note: this file is non standard, it's imported explicitly
// Reference: https://github.com/terser/terser
export default {
  format: {
    comments: false,
  },
  safari10: true,
}

{
  "compilerOptions": {
    "module": "esnext",
    "moduleResolution": "node16",
    "target": "es5",
    "removeComments": false,
    "resolveJsonModule": true,
    "importHelpers": true,
    "noErrorTruncation": true,
    "strict": true,
    "noUnusedLocals": true,
    "noUnusedParameters": true,
    "noImplicitReturns": true
  },
  // It must include everything that Rollup will encounter,
  // and preferably nothing else in order not to compile excess files
  "include": [
    "src/index.ts",
    "src/**/*.d.ts",
    "resources/content_blocking/selectors_tester.ts"
  ],
  "ts-node": {
    "compilerOptions": {
      "module": "commonjs",
      "target": "es2021"
    }
  }
}

// Used by Rollup to load its own configuration file
{
  "extends": "./tsconfig.json",
  "include": [
    "rollup.config.ts"
  ]
}
